(function () {
	'use strict';
    var $ = $ || window.$;
    var url = window.location.href;
    var host = window.location.host;
    var doiRegex = new RegExp('(?:^' + '(10[.][0-9]{4,}(?:[.][0-9]+)*/(?:(?![%"#? ])\\S)+)' + '$)');
    var default_server = GM_getValue("scihub-server", 'https://sci-hub.se/');
    if(GM_listValues().indexOf("scihub-server")==-1){
        GM_setValue("scihub-server", default_server);
    }
    GM_registerMenuCommand("Change Sci-Hub URL", changeSciHub);
    if(host == 'pubmed.ncbi.nlm.nih.gov'){
        addStyle();
        if(typeofpage()=='single'){
            var html = "<div class='pubmedy-impactfactor-container'><p>";
            var jn = $("button#full-view-journal-trigger").text().trim();
            var pmid = $("#full-view-identifiers .identifier.pubmed").text().trim().replace(/\D+/,'');
            var doi = $("#full-view-identifiers .identifier.doi").text().trim().replace(/^DOI:\s*/i,'');
            var jnscore = jn2score(jn);
            html += "<span><b>IF:</b>"+jnscore+"</span>";
            html +="<span><b>Cited: </b><i class='cited-num' data-pmid='"+pmid+"'>Click to View</i></span>";
            if(doiRegex.test(doi)){
                html += "<span><a target='_blank' href='"+default_server+doi+"'>Full Text(PDF)</a></span>";
            }
            html += "<span><a class='pubmedy-impactfactor-citation' href='#' data-id='"+pmid+"'><b>Citation</b></a></span>";
            html += "</p></div>";
            $("#full-view-heading").append(html);
        }else{
            $(".docsum-journal-citation.short-journal-citation").each(function(){
                var html = "<div class='pubmedy-impactfactor-container'><p>";
                var jn = $(this).text().trim().replace(/\.\s*\d{4}\.$/, '');
                var doi = '';
                doiRegex = new RegExp('(?:' + '(10[.][0-9]{4,}(?:[.][0-9]+)*/(?:(?![%"#? ])\\S)+)' + ')');
                var doiln = $(this).prev().text().trim().match(doiRegex);
                if(doiln){
                    doi = doiln[0];
                }
                var pmid = $(this).next().text().trim().replace(/\D+/,'');
                var jnscore = jn2score(jn);
                html += "<span><b>IF:</b>"+jnscore+"</span>";
                html +="<span><b>Cited: </b><i class='cited-num' data-pmid='"+pmid+"'>Click to View</i></span>";
                if(doi){
                    html += "<span><a target='_blank' href='"+default_server+doi+"'>Full Text(PDF)</a></span>";
                }
                html += "<span><a class='pubmedy-impactfactor-citation' href='#' data-id='"+pmid+"'><b>Citation</b></a></span>";
                html += "</p></div>";
                $(this).parent().append(html);
            });
        }
    }else{
        if($(".gs_r.gs_or.gs_scl").length){
            addStyle();
            $(".gs_r.gs_or.gs_scl").each(function(i, e){
                var title = $(this).children(".gs_ri:first").children("h3:first").text().trim();
                var url = $(this).children(".gs_ri:first").children("h3:first").children("a:first").attr("href");
                if(!url){
                    return true;
                }
                var jnline = $(this).children(".gs_ri:first").children(".gs_a:first").text().trim();
                var m = jnline.match(/\- ([A-Za-z ]*?), \d{4} \- /);
                var jn = '';
                if(m){
                    jn = m[1];
                }
                doiRegex = new RegExp('(?:' + '(10[.][0-9]{4,}(?:[.][0-9]+)*/(?:(?![%"#? ])\\S)+)' + ')');
                var mathedDOI = url.match(doiRegex);
                var doi = '';
                var jnscore = '';
                if(mathedDOI){
                    doi = mathedDOI[1];
                }
                if(jn){
                    jnscore = jn2score(jn);
                }
                var showbar = 0;
                if(jnscore=='' || jnscore=='-'){
                    if(doi){
                        jnscore="<i class='pubmedy-view-if' data-doi='"+doi+"'>View</i>";
                        showbar = 1;
                    }
                }else{
                    showbar = 1;
                }
                if(showbar){
                    var html = "<div class='pubmedy-impactfactor-tinybox'><p>";
                    html += "<span><b>IF:</b>"+jnscore+"</span>";
                    if(doi){
                        html += "<span><a target='_blank' href='"+default_server+doi+"'>Full Text(PDF)</a></span>";
                    }
                    html += "</p></div>";
                    $(this).children(".gs_ri:first").children(".gs_fl:first").append(html);
                }
            });
        }
    }
    $("body").on('click', ".pubmedy-view-if", function(){
        getJnScorefromDOI($(this).attr("data-doi"),this);
    })
    $('body').on('mouseup',function(event){
        var thetext = getSelectionText();
        var m = thetext.match(doiRegex)
        if (m && event.which==1){
            // event.which: 1 left mouse; 3 right mouse
            if(confirm("Sci-Hub Search:"+m[0])){
                GM_openInTab(default_server+m[0]);
            }
        }
    });
    $('body').on('mousedown',function(event){
        var thetext = getSelectionText();
        var m = thetext.match(doiRegex)
        if (m && event.which==1){
            window.getSelection().removeAllRanges();
        }
    });
    $("i.cited-num").on('click', function(){
        var pmid = $(this).attr("data-pmid");
        getCitationNum(pmid, this);
    });
    $("body").on('click', "a.pubmedy-view-citation-list", function (event) {
        event.preventDefault();
        var citationList = GM_getValue('citationList');
        var clist = jQuery.parseJSON(citationList);
        var listHTML = "<p>"+clist.join("</p><p>")+"</p>";
        var revealId = "pubmedy-citation-show";
        $('#' + revealId).remove();
        var loading = '<div id=' + revealId + ' class="reveal-modal">' + "<p class='pubmedy-rtn-citation'>"+listHTML+"<a class='close-reveal-modal'>×</a>" + '</div>';
        $('body').append(loading);
        $('#' + revealId).reveal({animation: "fade", revealId: revealId});
    });
    $("a.pubmedy-impactfactor-citation").on('click', function (event) {
        event.preventDefault();
        var revealId = "pubmedy-citation-show"
        $('#' + revealId).remove();
        var loading = '<div id=' + revealId + ' class="reveal-modal">' + "<p class='pubmedy-rtn-citation'>Loading...</p><a class='close-reveal-modal'>×</a>" + '</div>';
        $('body').append(loading);
        $('#' + revealId).reveal({animation: "fade", revealId: revealId});
        var pmid = $(this).attr('data-id');
        GM_xmlhttpRequest({
            method: "GET",
            url:"https://eutils.ncbi.nlm.nih.gov/entrez/eutils/esummary.fcgi?db=pubmed&id="+pmid+"&retmode=json",
            headers: {
                'User-agent': 'Mozilla/4.0 (compatible)',
                'Accept': 'application/atom+xml,application/xml,text/xml',
            },
            onload: function(resp){
                var summary = jQuery.parseJSON(resp['responseText']);
                var title = summary["result"][pmid]["title"];
                var journal = summary["result"][pmid]["source"];
                var volume = summary["result"][pmid]["volume"];
                var issue = summary["result"][pmid]["issue"];
                var pubdate = summary["result"][pmid]["pubdate"];
                pubdate = pubdate.replace(/(\d{4}).*/, "$1");
                var pages = summary["result"][pmid]["pages"];
                var authLst = summary["result"][pmid]["authors"];
                var authors = new Array();
                for(var i=0; i<authLst.length; i++){
                    authors.push(authLst[i]["name"]);
                }
                if(authors.length>6){
                    var xxauthors = authors.slice(0,6);
                    authors = xxauthors.join(", ")+", et al";
                }else{
                    authors = authors.join(", ")+"";
                }
                var d = new Array();
                if(authors){
                    d.push(authors);
                }
                if(title){
                    d.push(title.replace(/\.$/, ''));
                }
                if(journal){
                    d.push("<em>"+journal+"</em>");
                }
                if(pubdate){
                    if(volume && issue){
                        if(pages){
                            d.push(pubdate+";"+volume+"("+issue+"):"+pages);
                        }else{
                            d.push(pubdate+";"+volume+"("+issue+")")
                        }
                    }else{
                        d.push(pubdate);
                    }
                }
                var citation = d.join(". ");
                $('.pubmedy-rtn-citation').html(citation);
            },
             onerror: function(response){
              console.log("请求失败");
            }
          });
    });
})();
function getSelectionText(){
	var selectedText = ""
	if (window.getSelection){ // all modern browsers and IE9+
		selectedText = window.getSelection().toString().trim();
	}
	return selectedText
}
function changeSciHub() {
    default_server = GM_getValue("scihub-server");
    let newscihub = prompt("Please input a new Sci-Hub url. Leave it blank to get a new URL automatically", default_server);
    if (newscihub != null && newscihub !== "") {
        try {
            if (!fIsUrL(newscihub)) {
                alert("Invalid URL");
                return;
            }
            GM_setValue("scihub-server", newscihub);
        } catch (e) {
            alert("Could not set value.");
        }
    } else {
        GM_xmlhttpRequest({
            method: "GET",
            url: String.fromCharCode.apply(String, [47, 47, 119, 119, 119, 46, 110, 111, 118, 111, 112, 114, 111, 46, 99, 110, 47, 115, 99, 105, 104, 117, 98, 47]),
            headers: {
                'User-agent': 'Mozilla/4.0 (compatible)',
                'Accept': 'application/atom+xml,application/xml,text/xml',
            },
            onload: function (resp) {
                newscihub = resp['responseText'];
                console.log(newscihub);
                try {
                    if (!fIsUrL(newscihub)) {
                        alert("Invalid URL");
                        return;
                    }
                    GM_setValue("scihub-server", newscihub);
                } catch (e) {
                    alert("Could not set value.");
                }
            },
            onerror: function (response) {
                // console.log("请求失败");
                alert('Failed! I am afraid you have to set the sci-hub URL manually.')
            }
        });
    }
}
$.fn.reveal = function(options) {
	var defaults = {
		animation: 'fadeAndPop',
		//fade, fadeAndPop, none
		animationspeed: 300,
		//how fast animtions are
		closeonbackgroundclick: true,
		//if you click background will modal close?
		dismissmodalclass: 'close-reveal-modal' //the class of a button or element that will close an open modal
	};

	//Extend dem' options
	options = $.extend({}, defaults, options);

	return this.each(function() {

		var modal = $(this),
			topMeasure = parseInt(modal.css('top')),
			topOffset = modal.height() + topMeasure,
			locked = false,
			modalBG = $('.reveal-modal-bg');

		if (modalBG.length == 0) {
			modalBG = $('<div class="reveal-modal-bg" />').insertAfter(modal);
		}

		//Entrance Animations
		modal.bind('reveal:open', function() {
			modalBG.unbind('click.modalEvent');
			$('.' + options.dismissmodalclass).unbind('click.modalEvent');
			if (!locked) {
				lockModal();
				if (options.animation == "fadeAndPop") {
					modal.css({
						'top': $(document).scrollTop() - topOffset,
						'opacity': 0,
						'visibility': 'visible'
					});
					modalBG.fadeIn(options.animationspeed / 2);
					modal.delay(options.animationspeed / 2).animate({
						"top": $(document).scrollTop() + topMeasure + 'px',
						"opacity": 1
					}, options.animationspeed, unlockModal());
				}
				if (options.animation == "fade") {
					modal.css({
						'opacity': 0,
						'visibility': 'visible',
						'top': $(document).scrollTop() + topMeasure
					});
					modalBG.fadeIn(options.animationspeed / 2);
					modal.delay(options.animationspeed / 2).animate({
						"opacity": 1
					}, options.animationspeed, unlockModal());
				}
				if (options.animation == "none") {
					modal.css({
						'visibility': 'visible',
						'top': $(document).scrollTop() + topMeasure
					});
					modalBG.css({
						"display": "block"
					});
					unlockModal()
				}
			}
			modal.unbind('reveal:open');
		});

		//Closing Animation
		modal.bind('reveal:close', function() {
			if (!locked) {
				lockModal();
				if (options.animation == "fadeAndPop") {
					modalBG.delay(options.animationspeed).fadeOut(options.animationspeed);
					modal.animate({
						"top": $(document).scrollTop() - topOffset + 'px',
						"opacity": 0
					}, options.animationspeed / 2, function() {
						modal.css({
							'top': topMeasure,
							'opacity': 1,
							'visibility': 'hidden'
						});
						unlockModal();
					});
				}
				if (options.animation == "fade") {
					modalBG.delay(options.animationspeed).fadeOut(options.animationspeed);
					modal.animate({
						"opacity": 0
					}, options.animationspeed, function() {
						modal.css({
							'opacity': 1,
							'visibility': 'hidden',
							'top': topMeasure
						});
						unlockModal();
					});
				}
				if (options.animation == "none") {
					modal.css({
						'visibility': 'hidden',
						'top': topMeasure
					});
					modalBG.css({
						'display': 'none'
					});
				}
			}
			modal.unbind('reveal:close');
		});

		//Open Modal Immediately
		modal.trigger('reveal:open')

		//Close Modal Listeners
		var closeButton = $('.' + options.dismissmodalclass).bind('click.modalEvent', function() {
			modal.trigger('reveal:close')
		});

		if (options.closeonbackgroundclick) {
			modalBG.css({
				"cursor": "pointer"
			})
			modalBG.bind('click.modalEvent', function() {
				modal.trigger('reveal:close')
			});
		}
		$('body').keyup(function(e) {
			if (e.which === 27) {
				modal.trigger('reveal:close');
			} // 27 is the keycode for the Escape key
		});

		function unlockModal() {
			locked = false;
		}

		function lockModal() {
			locked = true;
		}

	}); //each call
}

function typeofpage() {
    if ($("#article-details").length > 0) {
        return 'single';
    } else {
        return 'list';
    }
}
function fIsUrL(sUrl) {
    var sRegex = '^((https|http)?://)' + '?(([0-9a-z_!~*\'().&=+$%-]+: )?[0-9a-z_!~*\'().&=+$%-]+@)?' //ftp的user@ 
        + '(([0-9]{1,3}.){3}[0-9]{1,3}' // IP形式的URL- 199.194.52.184 
        + '|' // 允许IP和DOMAIN（域名） 
        + '([0-9a-z_!~*\'()-]+.)*' // 域名- www. 
        + '([0-9a-z][0-9a-z-]{0,61})?[0-9a-z].' // 二级域名 
        + '[a-z]{2,6})' // first level domain- .com or .museum 
        + '(:[0-9]{1,4})?' // 端口- :80 
        + '((/?)|' // a slash isn't required if there is no file name 
        + '(/[0-9a-z_!~*\'().;?:@&=+$,%#-]+)+/?)$';
    var re = new RegExp(sRegex);
    //re.test() 
    if (re.test(sUrl)) {
        return true;
    }
    return false;
}
function getJnScorefromDOI(doi,ele){
    GM_xmlhttpRequest({
        method: "GET",
        url:"https://www.ebi.ac.uk/europepmc/webservices/rest/search?query=doi:" + doi + "&resultType=lite&cursorMark=*&pageSize=5&format=json",
        headers: {
            'User-agent': 'Mozilla/4.0 (compatible)',
            'Accept': 'application/atom+xml,application/xml,text/xml',
        },
        onload: function(resp){
            var epmcObj = jQuery.parseJSON(resp['responseText']);
            // console.log(epmcObj);
            var num = epmcObj['hitCount'];
            if(num==1){
                var journalTitle = epmcObj.resultList.result[0].journalTitle;
                var jnscore = jn2score(journalTitle);
                $(ele).text(jnscore);
            }
        },
         onerror: function(response){
        //   console.log("请求失败");
        }
      });
}

function getCitationNum(pmid, ele) {
    // https://docs.ropensci.org/europepmc/
    var num = 0;
    GM_xmlhttpRequest({
        method: "GET",
        url:"https://www.ebi.ac.uk/europepmc/webservices/rest/MED/" + pmid + "/citations?page=1&pageSize=100&format=json",
        headers: {
            'User-agent': 'Mozilla/4.0 (compatible)',
            'Accept': 'application/atom+xml,application/xml,text/xml',
        },
        onload: function(resp){
            var epmcObj = jQuery.parseJSON(resp['responseText']);
            // console.log(epmcObj);
            num = epmcObj['hitCount'];
            $(ele).text(num);
            if(num>0){
                var citationList = new Array();
                for(var i=0; i<epmcObj.citationList.citation.length;i++){
                    var d = new Array();
                    var xx = epmcObj.citationList.citation[i];
                    d.push(xx.authorString.replace(/\.$/,''));
                    d.push(xx.title.replace(/\.$/,''));
                    d.push("<em>"+xx.journalAbbreviation+"</em>");
                    if(xx.volume){
                        if(xx.pageInfo){
                            d.push(xx.pubYear+";"+xx.volume+":"+xx.pageInfo);
                        }else{
                            d.push(xx.pubYear+";"+xx.volume);
                        }
                    }else{
                        d.push(xx.pubYear);
                    }
                    d.push("PMID:<a href='//pubmed.ncbi.nlm.nih.gov/"+xx.id+"'>"+xx.id+"</a>")
                    citationList.push(d);
                }
                GM_setValue('citationList', JSON.stringify(citationList));
                $(ele).after('<a href="#" class="pubmedy-view-citation-list"><img src="data:image/png;base64,"/></a>');
            }
        },
         onerror: function(response){
        //   console.log("请求失败");
        }
      });
}

